CREATE TABLE `lt_membros` (
  `id` int(2) NOT NULL AUTO_INCREMENT,
  `nome` varchar(50) DEFAULT NULL,
  `dt_batismo` date DEFAULT NULL,
  `dt_ingresso` date DEFAULT NULL,
